import {useState} from 'react';
import './App.css';
import { BiSearch } from 'react-icons/bi';


function App() {
  const [state,setState]=useState(true);

  return (
    <div className="App">
      {(state) ? <BiSearch style={{color:"white",cursor:"pointer",fontSize:"2.5rem"}} onClick={()=>{setState(false)}}/> : <input type="search" placeholder="Search" id="inputBox" />}
    </div>
  );
}

export default App;
